css:
.git-plus .alert {
  color: #dccd69;
}
.git-plus .success {
  color: #9fca56;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #4f99d3;
}
.meta.diff.header {
  color: #4f99d3;
}
.markup.deleted.diff {
  color: #ce4045;
}
.markup.inserted.diff {
  color: #9fca56;
}
